# OEIS sequence: A163574

def vgen(n, b):
    if n == 1:
        t = list(range(1, b))
        for i in range(1, b):
            u = list(t)
            u.remove(i)
            yield i, u
    else:
        for d, v in vgen(n-1, b):
            for g in v:
                k = d*b+g
                if not k % n:
                    u = list(v)
                    u.remove(g)
                    yield k, u
def A163574(n):
    for a, b in vgen(n-1, n):
        return a
    return 0 # _Chai Wah Wu_, Jun 07 2015

